document.addEventListener("DOMContentLoaded",()=>{let a=document.querySelectorAll(".tpgb-section:not(.tpgb-section-editor),.tpgb-container-row:not(.tpgb-container-row-editor)");a&&a.forEach(a=>{if(a.classList.contains("tpgb-scroll-parallax")){var b=new ScrollMagic.Controller;let c=a.querySelector(".img-scroll-parallax");new ScrollMagic.Scene({triggerElement:a,triggerHook:1,duration:"200%"}).setTween(TweenMax.fromTo(c,1,{backgroundPositionY:"15%",ease:"Power0.easeNone"},{backgroundPositionY:"85%",ease:"Power0.easeNone"})).addTo(b)}})});